/*Table structure for table `gen_template` */

DROP TABLE IF EXISTS `gen_template`;

CREATE TABLE `gen_template` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `name` varchar(200) DEFAULT NULL COMMENT '名称',
  `category` varchar(2000) DEFAULT NULL COMMENT '分类',
  `file_path` varchar(500) DEFAULT NULL COMMENT '生成文件路径',
  `file_name` varchar(200) DEFAULT NULL COMMENT '生成文件名',
  `content` text COMMENT '内容',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记（0：正常；1：删除）',
  PRIMARY KEY (`id`),
  KEY `gen_template_del_falg` (`del_flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='代码模板表';

/*Data for the table `gen_template` */

/*Table structure for table `notify_mail` */

DROP TABLE IF EXISTS `notify_mail`;

CREATE TABLE `notify_mail` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `title` varchar(100) DEFAULT NULL COMMENT '标题',
  `content` varchar(500) DEFAULT NULL COMMENT '内容',
  `notice_type` char(1) DEFAULT NULL COMMENT '类型（数据字典）\n1:',
  `user_id` int(11) DEFAULT NULL COMMENT '会员Id',
  `app_type` tinyint(4) DEFAULT NULL COMMENT 'app类别',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `biz_no` varchar(20) DEFAULT NULL COMMENT '业务编码(订单号)',
  `is_read` tinyint(4) DEFAULT '0' COMMENT '是否已读(0:未读 1:已读)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='站内信（notify_mail）';

/*Data for the table `notify_mail` */

/*Table structure for table `notify_sms` */

DROP TABLE IF EXISTS `notify_sms`;

CREATE TABLE `notify_sms` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `phone` varchar(20) DEFAULT NULL COMMENT '接收手机',
  `content` varchar(256) DEFAULT NULL COMMENT '短信内容',
  `sms_type` tinyint(4) DEFAULT NULL COMMENT '短信类型(1:找回密码)',
  `sms_status` tinyint(4) DEFAULT NULL COMMENT '状态(0:提交失败2:提交成功 3:发送成功)',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(100) DEFAULT NULL COMMENT '备注',
  `smsid` varchar(30) DEFAULT NULL COMMENT '消息id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='短信（notify_sms）';

/*Data for the table `notify_sms` */

/*Table structure for table `notify_sms_template` */

DROP TABLE IF EXISTS `notify_sms_template`;

CREATE TABLE `notify_sms_template` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `sms_type` tinyint(4) DEFAULT NULL COMMENT '模板类别(1:找回密码)',
  `content` varchar(256) DEFAULT NULL COMMENT '模板内容',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` int(11) DEFAULT NULL COMMENT '创建人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` int(11) DEFAULT NULL COMMENT '更新人',
  `sms_template_id` varchar(30) DEFAULT NULL COMMENT '第三方模板Id',
  `signature` varchar(30) DEFAULT NULL COMMENT '短信签名',
