/*Table structure for table `sys_app_session` */

DROP TABLE IF EXISTS `sys_app_session`;

CREATE TABLE `sys_app_session` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键Id',
  `token_id` varchar(32) NOT NULL COMMENT 'tokenId',
  `account` varchar(20) NOT NULL COMMENT '账号',
  `app_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT 'app类别(1:医生端)',
  `failure_time` datetime NOT NULL COMMENT '失效时间',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记(0:正常 1:删除)',
  `device_no` varchar(100) NOT NULL COMMENT '移动设备号',
  `device_token` varchar(100) DEFAULT NULL COMMENT '设备token(ios推送)',
  `sys_type` tinyint(4) NOT NULL DEFAULT '1' COMMENT '手机操作系统(1:ios 2:安卓 3:h5)',
  `phone_model` varchar(120) DEFAULT NULL COMMENT '手机型号',
  `app_version` varchar(10) DEFAULT NULL COMMENT 'App应用版本(current_version)',
  `update_date` datetime NOT NULL COMMENT '更新时间',
  `open_id` varchar(100) DEFAULT NULL COMMENT '微信openid',
  PRIMARY KEY (`id`),
  KEY `idx_session_token` (`token_id`) USING BTREE,
  KEY `idx_session_delflag` (`del_flag`) USING BTREE,
  KEY `idx_session_failure_time` (`failure_time`) USING BTREE,
  KEY `idx_session_account` (`account`,`app_type`,`device_no`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='移动AppSession记录表';

