/*Table structure for table `sys_carousel_conf` */

DROP TABLE IF EXISTS `sys_carousel_conf`;

CREATE TABLE `sys_carousel_conf` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `carousel_type` char(2) DEFAULT NULL COMMENT '轮播图类型(数据字典:carousel_type)',
  `title` varchar(100) DEFAULT NULL COMMENT '标题',
  `url` varchar(500) DEFAULT NULL COMMENT '图片地址',
  `is_href` char(1) DEFAULT NULL COMMENT '是否是链接(1:是 0:不是)',
  `target_url` varchar(500) DEFAULT NULL COMMENT '目标链接',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `remark` varchar(255) DEFAULT NULL COMMENT '备注',
  `create_by` int(11) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` int(11) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标记(0:正常1:删除)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='轮播图表';

