/*Table structure for table `sys_code_rule` */

DROP TABLE IF EXISTS `sys_code_rule`;

CREATE TABLE `sys_code_rule` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `request_id` varchar(30) COLLATE utf8_bin NOT NULL COMMENT '请求id，该id为业务系统预先知道的',
  `request_name` varchar(60) COLLATE utf8_bin NOT NULL COMMENT '请求名称，如仓库引进单',
  `prefix` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '前缀',
  `current_serial_no` int(11) NOT NULL DEFAULT '1' COMMENT '当前序号',
  `serial_no_length` int(11) NOT NULL DEFAULT '6' COMMENT '序号长度',
  `reset_mode` int(11) NOT NULL DEFAULT '1' COMMENT '重置模式(0:永不重置 1:按天重置 2:按月重置 3:按年重置)',
  `reset_time` datetime DEFAULT NULL COMMENT '重置时间，在判断是否需要重置时有用',
  `allow_break_no` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否允许断号，1表示允许，0表示不允许，允许时会在应用程序中缓存10个序号，不允许时，每次都从数据库请求，允许断号性能更好',
  `is_abstract` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否抽象。1表抽象，抽象的不能建立实例化，只能作为模板供其他复制',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ux_code_rule` (`request_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='编码规则';

/*Data for the table `sys_code_rule` */

insert  into `sys_code_rule`(`id`,`request_id`,`request_name`,`prefix`,`current_serial_no`,`serial_no_length`,`reset_mode`,`reset_time`,`allow_break_no`,`is_abstract`,`remarks`) values (1,'goods_no','商品编码','1',360,9,0,NULL,0,0,NULL);

/*Table structure for table `sys_dict_dtl` */

DROP TABLE IF EXISTS `sys_dict_dtl`;

CREATE TABLE `sys_dict_dtl` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键Id',
  `dict_id` int(11) NOT NULL COMMENT '字典类型Id',
  `name` varchar(100) NOT NULL COMMENT '名称',
  `code` varchar(100) NOT NULL COMMENT '代码',
  `calculate_val` decimal(12,4) DEFAULT NULL COMMENT '计算值',
  `sort` int(11) NOT NULL COMMENT '显示顺序',
  `description` varchar(100) DEFAULT NULL COMMENT '描述',
  `create_by` varchar(64) NOT NULL COMMENT '创建人',
  `create_date` datetime NOT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新人',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
