/*Table structure for table `sys_front_account` */

DROP TABLE IF EXISTS `sys_front_account`;

CREATE TABLE `sys_front_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键Id',
  `account` varchar(20) NOT NULL COMMENT '帐号',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机号',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `password` varchar(32) NOT NULL COMMENT '密码',
  `trade_password` varchar(32) DEFAULT NULL COMMENT '交易密码',
  `amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '账户余额',
  `freeze_amount` decimal(12,2) NOT NULL DEFAULT '0.00' COMMENT '冻结余额',
  `margin_amount` decimal(12,2) DEFAULT '0.00' COMMENT '保证金',
  `sex` char(1) DEFAULT '1' COMMENT '性别(1:男 2:女)',
  `nick_name` varchar(64) DEFAULT NULL COMMENT '昵称',
  `portrait` varchar(500) DEFAULT NULL COMMENT '头像地址',
  `open_id` varchar(60) DEFAULT NULL COMMENT '关注openid',
  `bind_wx` varchar(32) DEFAULT NULL COMMENT '绑定的微信号',
  `bind_weibo` varchar(32) DEFAULT NULL COMMENT '绑定的微博号',
  `bind_qq` varchar(12) DEFAULT NULL COMMENT '绑定的QQ号',
  `last_logintime` datetime DEFAULT NULL COMMENT '上次登录时间',
  `login_times` int(11) DEFAULT NULL COMMENT '登录次数',
  `status` char(2) DEFAULT '0' COMMENT '账号状态(0:正常 1:锁定)',
  `user_type` char(2) DEFAULT '0' COMMENT '用户类型(0:承运商 1:货主)',
  `remark` varchar(500) DEFAULT NULL COMMENT '备用字段',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标记(0:正常 1:删除)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=214 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='前台账户表';

