/*Table structure for table `sys_image_conf` */

DROP TABLE IF EXISTS `sys_image_conf`;

CREATE TABLE `sys_image_conf` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键Id',
  `image_type` int(11) NOT NULL DEFAULT '0' COMMENT '图片类型(数据字典:image_type)',
  `image_path` varchar(200) NOT NULL COMMENT '图片相对路径(图片服务器：app/icon/)',
  `sub_dir_format` varchar(200) DEFAULT 'yyyyMM' COMMENT '子目录格式(yyyyMM|yyyyMMdd)',
  `is_original_compress` char(1) DEFAULT '1' COMMENT '原图是否需要压缩(1:是 0:否)',
  `original_size` varchar(30) DEFAULT '1024X1024' COMMENT '原图尺寸(1024X1024)',
  `is_thumb` char(1) DEFAULT '1' COMMENT '是否需要缩略图(1:是 0:否)',
  `thumb_size` varchar(30) DEFAULT '230X230' COMMENT '缩略图尺寸(230X230)',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='系统图片配置表';

